// import "./BingoSquare.css";
import "./BingoBoard.css";
// import React, { useState, useEffect } from "react";

// function BingoBoard({ items }) {
function BingoBoard() {
  // console.log(items);

  const items = [
    "생각은 많은데 행동이 안 따라줌",
    "어린애들이랑 잘 어울림",
    "열쩡! 열쩡! 열쩡!",
    "공감능력 최상",
    "의리 없으면 시체",
    "매사가 감정의 롤러코스터",
    "아싸",
    "전체주의 NO. 각자만의 길",
    "불안초조예민",
    "눈치 많이 보는 편",
    "이상주의적",
    "유리멘탈",
    "INFP",
    "판타지물 등 신비롭고 몽환적인 것을 좋아함",
    "항상 올바른 길을 택하고자 함",
    "갈등은 어떻게든 피하는 쪽",
    "다른 사람들을 이해하고 싶다",
    "이야기 잘 들어줌",
    "미술, 글쓰기 등 예술성",
    "우울한 힙스터",
    "꾀가 많음",
    "단체생활 체질 아님",
    "몽상가",
    "신적 존재를 믿음",
    "글을 많이 읽는 편",
  ];

  // splitting an array into chunks of 5 items each
  let rows = [],
    size = 5;
  for (let i = 0; i < items.length; i += size)
    rows.push(items.slice(i, i + size));
  console.log(rows);

  // let itemRows = [];
  // const rowLength = 5;
  // for (let i = 0; i < items.length; i += rowLength) {
  //   const row = items.slice(i, i + rowLength);
  //   itemRows.push(row);
  // }
  // // console.log(row);
  // console.log(itemRows);

  // let dataChunk = chunk(items, 5);
  // console.log(dataChunk);

  let rowDivs = [];
  for (let i = 0; i < rows.length; i++) {
    rowDivs.push(<div className="row"></div>);
  }

  return (
    <>
      <div className="container">{rowDivs}</div>

      <br></br>

      <div className="container">
        <div className="row">
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
        </div>
        <div className="row">
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
        </div>
        <div className="row">
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
        </div>
        <div className="row">
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
        </div>
        <div className="row">
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
          <div className="col"></div>
        </div>
      </div>

      {/* <div>
        {items.map((item) => (
          <li>{item}</li>
        ))}
      </div> */}

      <div>
        {rows.map((row) => (
          <div>{row}</div>
        ))}
      </div>
    </>
  );
}

export default BingoBoard;
